Esse talvez seja o maior mito da musculação. 
Por que o leite atrapalha na definição? Por que ele engrossa a pele?
Isso não existe para pessoas com boa fabricação da enzima lactase.

O corpo adulto tem uma produção ligeiramente baixa de lactase, essa lactase que faz a digestão da lactose (carboidrato do leite). Se consumido em grandes quantidades (1 litro ou mais de uma vez, pra maioria das pessoas) pode causar inchaço, dores abdominais e diarreia.
Porém consumidos em quantidades que seu corpo da conta, é um alimento maravilhoso. PONTO!

Análise ligeira da composição do leite:
Água - OK!
Proteínas - Alto valor biológico, OK!
Gorduras - Na versão desnatada, zero ou < 1, OK!
Carboidrato - Lactose, se consumido dentro do SEU limite natural, OK!
Vitaminas - A, D, E, K, B1, B2, B6, B12, ácido pantotênico e niacina, OK!
Sais minerais - Fosfatos, citratos, carbonato de sódio, cálcio, potássio e magnésio, OK!

Uma dica pra aumentar o seu limite natural de digestão de lactose, ou seja, aumentar as suas lactases: consuma mais iogurte!

Agora, claro, se há uma fraude nos leites de caixinha de hoje, é algo a se cuidar. Mas o leite em si não é o problema... #hipertrofia #fitness #emagrecimento #academia #treino #musculacao #gym #dieta #foco #musculação #vidasaudavel #saude #personaltrainer #nopainnogain #bodybuilding #maromba #estilodevida #esmagaquecresce #lowcarb #lifestyle #nutricionista #instafit #emagrecer #fit #bodybuilder #instagood #bemestar #vemmonstro #fikagrandeporra #saúde";}i:121;a:1:{s:14:"comments_count";i:1;}i:122;a:1:{s:11:"likes_count";i:9;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvJx1Fj39R";}i:124;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118774907_391717218476430_2209090756828415701_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=xPQO0SQ1EzwAX8FQae9&oh=915fbaafe442fe514d670c2d3e5570d5&oe=5F7CC4EA";}i:125;a:1:{s:4:"type";s:5:"image";}i:126;a:1:{s:8:"owner_id";i:38296224771;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391172451386820705";}i:131;a:1:{s:10:"short_code";s:11:"CEvJqzxnIhh";}i:132;a:1:{s:12:"created_time";i:1599269990;}i:133;a:1:{s:7:"caption";s:21:"vestígios.. 🍃🧡";}i:134;a:1:{s:14:"comments_count";i:4;}i:135;a:1:{s:11:"likes_count";i:21;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvJqzxnIhh";}i:137;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118770891_720603905452153_6559358806585127268_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=Xirr_CD86JwAX9ToE8U&oh=36f71985b2a569a170ace58bdeb28019&oe=5F7D14B9";}i:138;a:1:{s:4:"type";s:7:"sidecar";}i:139;a:1:{s:8:"owner_id";i:195976102;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2391171290729177485";}i:144;a:1:{s:10:"short_code";s:11:"CEvJZ61BmGN";}i:145;a:1:{s:12:"created_time";i:15992698